var Foo = function(strategy) {
    this.strategy = strategy;
};
Foo.prototype.setStrategy = function(strategy) {
    this.strategy = strategy;
};
Foo.prototype.test = function() {
    return this.strategy.test();
}; 
function testContexts() {
    var i;
    var j;
    var ITER = 1000;
    var CALLS = 100;
    var beginning_time = new Date().getTime();
    var foo = new Foo(new BaseClass);
    for(i = 0; i < ITER; i++) {
        num = 1 + Math.floor(Math.random()*10000);
        foo.setStrategy(eval("new Strategy" + num));
        for(j = 1; j <= CALLS; j++) {
            foo.test();
        }
    }
    var end_time = new Date().getTime();
    return end_time - beginning_time;
} 

function runs(run) {
    var fs = require("fs");
    var times;
    fs.writeFileSync("./runs_strategy/10000/test"+run+".csv", "");
    fs.appendFileSync("./runs_strategy/10000/test"+run+".csv", "iteration, Elapsed time in milliseconds \n");
    for(times = 1; times <= 100; times++) {
        var elapsed_time = testContexts();
        fs.appendFileSync("./runs_strategy/10000/test"+run+".csv", times + "," + elapsed_time + "\n");
    }
}

var run;
for(run=1; run <=10; run++) {
    runs(run);
}

